import React from "react";
import "./styles.scss";
import { Box, Grid } from "@material-ui/core";

export default function Home() {
  return (
    <Box className="home-admin">
      <Grid container spacing={1}>
        <Grid item xs></Grid>
      </Grid>
    </Box>
  );
}
